import axios from "axios";
export const RegisterApi = async (inputs) => {
  let data = {
    displayName: inputs.username,
    email: inputs.email,
    //mobileNo: inputs.mobileNo,
    password: inputs.password,
    role: inputs.role,
  };
  return axios.post("http://localhost:3055/api/user/register", data);
};
